import React, { useState } from 'react';
import { useMenuData } from '../context/menuContext';

const AddMenu = (props) => {
    const { addMenu } = useMenuData(); // Use the custom hook to access addMenu

    const [menu, setMenu] = useState({ name: "", category: "", price: "", description: "", file: "" })
    const [selectedCategory, setSelectedCategory] = useState("");
    const categories = [
        { key: 1, value: 'Chinese' },
        { key: 2, value: 'Italian' },
        { key: 3, value: 'Indian' },
        { key: 4, value: 'Beverages' }
      ];

    const handleClick = (e) => {
        e.preventDefault();
        addMenu(menu.name, menu.category, menu.price, menu.description, menu.file);
        setMenu({ name: '', category: '', price: '', description: '', file: '' });
        props.showAlert('Added Successfully', 'success');
    };

    const handleCategorySelect = (category) => {
        setSelectedCategory(category);
        setMenu({ ...menu, category });
    }

    const onChange = (e) => {
        setMenu({ ...menu, [e.target.name]: e.target.value })
    }

    // useEffect(() => {
    //     // Dispatch the addMenu action when any of these menu properties change
    //     addMenu(menu.name, menu.category, menu.price, menu.description, menu.file);
    //   }, [menu.name, menu.category, menu.price, menu.description, menu.file, addMenu]); 

    const categoryList = React.Children.toArray(
        categories.map((ecategory) => (
          <li key={ecategory.key}>
            <button
              className={`dropdown-item ${selectedCategory === ecategory ? 'selected-category' : ''}`}
              onClick={() => handleCategorySelect(ecategory)}
              type="button"
            >
              {ecategory.value}
            </button>
          </li>
        ))
      ); 

    return (
        <div className='container my-3'>
            <h3>Add Menu</h3>
            <form className='my-3'>
                <div className="dropdown">
                    <button
                        className="btn btn-secondary dropdown-toggle"
                        type="button"
                        data-bs-toggle="dropdown"
                        aria-expanded="false"
                        style={{ marginBottom: '5px', marginLeft: '0px' }}
                    >
                        {selectedCategory || "Category"} {/* Display the selected category or a default text */}
                    </button>
                    <ul className="dropdown-menu">
                       {categoryList}
                    </ul>
                </div>
                <div className="mb-3">
                    <label htmlFor="name" className="form-label">Name</label>
                    <input type="text" className="form-control" id="name" name="name" onChange={onChange} value={menu.name} />
                </div>
                <div className="mb-3">
                    <label htmlFor="price" className="form-label">Price</label>
                    <input type="number" className="form-control" id="price" name="price"
                        value={menu.price} onChange={onChange} />
                </div>
                <div className="mb-3">
                    <label htmlFor="description" className="form-label">Description</label>
                    <textarea className="form-control" id="description" rows="3" name="description"
                        value={menu.description} onChange={onChange}></textarea>
                </div>
                <div className="mb-3">
                    <label htmlFor="file" className="form-label">Select a File</label>
                    <input className="form-control" type="text" id="file" name="file"
                        value={menu.file} onChange={onChange} />
                </div>
                <div className="modal-footer">
                    <button type='submit' className='btn btn-primary' onClick={handleClick}>
                        Add Menu
                    </button>
                </div>
            </form>
        </div>
    )
}
export default AddMenu
